import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Observable } from 'rxjs';
import { PictureService } from 'src/app/services/picture.service';
import { Picture } from 'src/app/shared/models/Pictures';


@Component({
  selector: 'app-picture-page',
  templateUrl: './picture-page.component.html',
  styleUrls: ['./picture-page.component.css']
})
export class PicturePageComponent implements OnInit{
  pictures:Picture[]=[];
  constructor(private pictureService: PictureService, activatedRoot: ActivatedRoute){
    let pictureObservable:Observable<Picture[]>;
   pictureObservable=pictureService.getAll();
   pictureObservable.subscribe((serverPictures)=>{
    this.pictures=serverPictures;
   })
  }
ngOnInit():void{

}

